import * as React from 'react';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Box, Button, Container, Drawer, IconButton, List, ListItem, ListItemText, Toolbar, Typography, useMediaQuery } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { Switch, Route } from 'react-router-dom';
import MobileMenu from './MobileMenu';
import Home from './pages/Home';
import About from './pages/About';
import BeautifulPlaces from './pages/BeautifulPlaces';
import OpenAI from './pages/OpenAI';
import SignUp from './pages/SignUp';


function Navbar() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [isDrawerOpen, setIsDrawerOpen] = useState(false);
  const isMobile = useMediaQuery('(max-width:600px)');

  const handleLogIn = () => {
    setIsLoggedIn(true);
  };

  const handleLogOut = () => {
    setIsLoggedIn(false);
  };

  const handleDrawerToggle = () => {
    setIsDrawerOpen(!isDrawerOpen);
  }

  const DrawerContent = () => (
    <List>
      <ListItem button component={Link} to="/" onClick={handleDrawerToggle}>
        <ListItemText primary="Home" />
      </ListItem>
      <ListItem button component={Link} to="/about" onClick={handleDrawerToggle}>
        <ListItemText primary="About" />
      </ListItem>
      <ListItem button component={Link} to="/beautifulplaces" onClick={handleDrawerToggle}>
        <ListItemText primary="Beautiful Places" />
      </ListItem>
      <ListItem button component={Link} to="/openai" onClick={handleDrawerToggle}>
        <ListItemText primary="OpenAI" />
      </ListItem>
      {isLoggedIn ? (
        <ListItem button onClick={handleLogOut}>
          <ListItemText primary="Log Out" />
        </ListItem>
      ) : (
        <>
          <ListItem button onClick={handleLogIn}>
            <ListItemText primary="Log In" />
          </ListItem>
          <ListItem button component={Link} to="/signup" onClick={handleDrawerToggle}>
            <ListItemText primary="Sign Up" />
          </ListItem>
        </>
      )}
    </List>
  );

  const DesktopMenu = () => (
    <>
      <Button color="inherit" component={Link} to="/">
        Home
      </Button>
      <Button color="inherit" component={Link} to="/about">
        About
      </Button>
      <Button color="inherit" component={Link} to="/beautifulplaces">
        Beautiful Places
      </Button>
      <Button color="inherit" component={Link} to="/openai">
        OpenAI
      </Button>
      {isLoggedIn ? (
        <Button color="inherit" variant="outlined" onClick={handleLogOut}>
          Log Out
        </Button>
      ) : (
        <>
          <Button color="inherit" variant="outlined" sx={{ mr: 3 }} onClick={handleLogIn}>
            Log In
          </Button>
          <Button color="secondary" variant="contained" component={Link} to="/signup">
            Sign Up
          </Button>
        </>
      )}
    </>
  );

  return (
    <>
      <AppBar position="fixed">
        <Container fixed>
          <Toolbar>
            {isMobile ? (
              <>
                <IconButton edge="start" color="inherit" aria-label="menu" onClick={handleDrawerToggle}>
                  <MenuIcon />
                </IconButton>
                <Typography variant="h6">Nomad's Odyssey</Typography>
              </>
            ) : (
              <>
                <Typography variant="h6" sx={{ mr: 3 }}>Nomad's Odyssey</Typography>
                <DesktopMenu />
              </>
            )}
            <Box sx={{ flexGrow: 1 }} />
          </Toolbar>
        </Container>
      </AppBar>
      {isMobile && (
        <MobileMenu isOpen={isDrawerOpen} handleDrawerToggle={handleDrawerToggle} handleLogIn={handleLogIn} handleLogOut={handleLogOut} isLoggedIn={isLoggedIn} />
      )}
      {!isMobile && (
        <Box sx={{ paddingTop: 12 }}>
          <Container fixed>
            <Switch>
              <Route exact path="/">
                <Home />
              </Route>
              <Route path="/about">
                <About />
              </Route>
              <Route path="/beautifulplaces">
                <BeautifulPlaces />
              </Route>
              <Route path="/openai">
                <OpenAI />
              </Route>
              <Route path="/signup">
                <SignUp />
              </Route>
            </Switch>
          </Container>
        </Box>
      )}
    </>
  );
}

export default Navbar;
